class Solution:
    def minimumDeletions(self, s: str) -> int:
        # At every point in our traversal, if we encounter an 'a',
        # we can either:
        # (i) delete every 'b' up to that point, or
        # (ii) we can delete that one 'a'
        # Of these two, we choose the method that has minimum operations.
        # [result] keeps a running total of the minimum number of
        # deletions we have made so far in order to keep the string
        # up to that point balanced.
        result = 0
        b_count = 0
        for ch in s:
            if ch == 'b':
                b_count += 1
            else:
                result = min(b_count, result+1)
        return result

# Main section
for s in [
            'aababbab',
            'bbaaaaabb',
            'aaaabbb',
            'bbbaaaa',
            'bbbaa',
            '',
         ]:
    print(f's = {s}')
    sol = Solution()
    r = sol.minimumDeletions(s)
    print(f'r = {r}')
    print('=================')


